import React from "react";
import authImage from "../assets/auth-image.svg";

const AuthLayout = ({ children, title }) => {
  return (
    <div className="w-full h-screen overflow-hidden flex items-start gap-4 p-8">
      <div className="w-1/2">
        <div></div>

        <div className="my-auto">{children}</div>
      </div>
      <div className="gap-4 h-full w-1/2 rounded-lg bg-slate-700 text-white flex flex-col items-center justify-center text-3xl font-semibold">
        <img src={authImage} alt="Auth" />
        {title}
      </div>
    </div>
  );
};

export default AuthLayout;
